import Link from "next/link";

const Index = () => (
  <div>
    <ul>
      <li>
        <Link href="/">Home</Link>
        <Link href="/about">About</Link>
      </li>
    </ul>
    <h1>About BizPrices</h1>
  </div>
);

export default Index;
